INSERT INTO `project_sql` VALUES ('59', '738858963333570560', '739888570073686016', 'DROP DATABASE if EXISTS treasure;\nCREATE DATABASE treasure;\nUSE treasure;\n /*\r\nNavicat MariaDB Data Transfer\r\n\r\nSource Server         : 192.168.10.250\r\nSource Server Version : 100208\r\nSource Host           : 192.168.10.250:3306\r\nSource Database       : cycle\r\n\r\nTarget Server Type    : MariaDB\r\nTarget Server Version : 100208\r\nFile Encoding         : 65001\r\n\r\nDate: 2018-01-23 09:02:02\r\n*/\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for admin\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `admin`;\r\nCREATE TABLE `admin` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\r\n  `code` char(32) NOT NULL COMMENT \'管理员编码\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'管理员名称\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登录账户(长度限制4-16)\',\r\n  `pwd` char(32) NOT NULL COMMENT \'密码(MD5加密32位)\',\r\n  `phone` char(11) DEFAULT NULL COMMENT \'手机号码\',\r\n  `idcard` char(18) DEFAULT NULL COMMENT \'身份证号\',\r\n  `role` varchar(8) DEFAULT \'NORMAL\' COMMENT \'角色（NORMAL 普通，SUPER 高级）\',\r\n  `state` char(16) DEFAULT \'OPEN\' COMMENT \'状态（OPEN 开启，DELETE 删除）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'管理员表\';\r\n\r\n-- ----------------------------\r\n-- Records of admin\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for basic_settings\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `basic_settings`;\r\nCREATE TABLE `basic_settings` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `k` varchar(32) NOT NULL COMMENT \'键\',\r\n  `v` text NOT NULL COMMENT \'值\',\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'系统基础关键配置表\';\r\n\r\n-- ----------------------------\r\n-- Records of basic_settings\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for coupon\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `coupon`;\r\nCREATE TABLE `coupon` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `release_user_code` char(32) DEFAULT NULL COMMENT \'释放人编码（直接触发人）\',\r\n  `indirect_user_code` char(32) DEFAULT NULL COMMENT \'间接释放人编码（第二层购买时产生）\',\r\n  `remark` varchar(256) NOT NULL COMMENT \'释放说明（您推广的B成功推广了C，为您释放16张代金券）\',\r\n  `coupon_code` char(32) NOT NULL COMMENT \'代金券编码\',\r\n  `num` smallint(6) NOT NULL COMMENT \'代金券期数\',\r\n  `coupon_price` decimal(10,2) NOT NULL COMMENT \'代金券面额\',\r\n  `fund_rate` smallint(6) DEFAULT NULL COMMENT \'基金抽取比例(1700代表17%)\',\r\n  `fund` decimal(10,2) DEFAULT NULL COMMENT \'抽取基金\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'实际释放额\',\r\n  `is_release` char(1) DEFAULT \'N\' COMMENT \'状态(Y: 已释放,N: 未释放)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `release_time` datetime DEFAULT NULL COMMENT \'释放时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'代金券释放计划（已完成的礼包中所有返还计划转移至历史表）\';\r\n\r\n-- ----------------------------\r\n-- Records of coupon\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for coupon_his\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `coupon_his`;\r\nCREATE TABLE `coupon_his` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `release_user_code` char(32) DEFAULT NULL COMMENT \'释放人编码（直接触发人）\',\r\n  `indirect_user_code` char(32) DEFAULT NULL COMMENT \'间接释放人编码（第二层购买时产生）\',\r\n  `remark` varchar(256) NOT NULL COMMENT \'释放说明（您推广的B成功推广了C，为您释放16张代金券）\',\r\n  `coupon_code` char(32) NOT NULL COMMENT \'代金券编码\',\r\n  `num` smallint(6) NOT NULL COMMENT \'代金券期数\',\r\n  `coupon_price` decimal(10,2) NOT NULL COMMENT \'代金券面额\',\r\n  `fund_rate` smallint(6) DEFAULT NULL COMMENT \'基金抽取比例(1700代表17%)\',\r\n  `fund` decimal(10,2) DEFAULT NULL COMMENT \'抽取基金\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'实际释放额\',\r\n  `is_release` char(1) DEFAULT \'Y\' COMMENT \'状态(Y: 已释放,N: 未释放)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `release_time` datetime DEFAULT NULL COMMENT \'释放时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'代金券释放计划历史表（已完成的礼包中所有返还计划转移至此）\';\r\n\r\n-- ----------------------------\r\n-- Records of coupon_his\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finace_plat\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finace_plat`;\r\nCREATE TABLE `finace_plat` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'总入账\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'总出账\',\r\n  `vn` bigint(20) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'平台财务账户\';\r\n\r\n-- ----------------------------\r\n-- Records of finace_plat\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finace_plat_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finace_plat_rec`;\r\nCREATE TABLE `finace_plat_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(32) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'平台财务流水\';\r\n\r\n-- ----------------------------\r\n-- Records of finace_plat_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for goods\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `goods`;\r\nCREATE TABLE `goods` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `goods_code` char(32) NOT NULL COMMENT \'商品编码\',\r\n  `goods_name` varchar(128) NOT NULL COMMENT \'商品名称\',\r\n  `goods_jingle` varchar(150) NOT NULL COMMENT \'商品广告词\',\r\n  `goods_image` varchar(128) NOT NULL COMMENT \'商品主图\',\r\n  `price` decimal(10,2) NOT NULL COMMENT \'价格\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'状态 DOWN下架，NORMAL正常\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'商品\';\r\n\r\n-- ----------------------------\r\n-- Records of goods\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for goods_buy_record\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `goods_buy_record`;\r\nCREATE TABLE `goods_buy_record` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `goods_code` char(32) NOT NULL COMMENT \'商品编码\',\r\n  `goods_name` varchar(128) NOT NULL COMMENT \'商品名称\',\r\n  `goods_image` varchar(128) NOT NULL COMMENT \'商品主图\',\r\n  `is_first_buy` char(1) DEFAULT \'N\' COMMENT \'是否首次购买（Y 是，N否）当为Y时，需要用户完善收货信息及平台发货\',\r\n  `is_delivery` char(1) DEFAULT \'N\' COMMENT \'是否已发货（Y 是，N 否）\',\r\n  `activation_code` char(10) DEFAULT NULL COMMENT \'使用的激活码(is_first_buy=N时,此项为空)\',\r\n  `name` char(10) DEFAULT NULL COMMENT \'收货人姓名\',\r\n  `phone` char(10) DEFAULT NULL COMMENT \'收货人电话\',\r\n  `address` char(10) DEFAULT NULL COMMENT \'收货人地址\',\r\n  `price` decimal(10,2) NOT NULL COMMENT \'价格\',\r\n  `state` varchar(4) NOT NULL DEFAULT \'ING\' COMMENT \'释放状态(ING 释放中，OVER 释放完毕)\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'商品购买记录（释放完毕的礼包中对应的所有代金券转移至代金券历史表，复投时改变用户表is_need_cycle）\';\r\n\r\n-- ----------------------------\r\n-- Records of goods_buy_record\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for orders\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `orders`;\r\nCREATE TABLE `orders` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `order_code` char(32) NOT NULL COMMENT \'订单号\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登陆账户（长度4-16）\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'姓名\',\r\n  `phone` varchar(16) DEFAULT NULL COMMENT \'电话（仅限手机号）\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `total_price` decimal(10,2) NOT NULL COMMENT \'订单总额\',\r\n  `brokerage` decimal(10,2) NOT NULL DEFAULT 0.00 COMMENT \'订单手续费\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'CR\' COMMENT \'状态(CR 创建订单, DONE 处理完成, CANCLE 取消订单)\',\r\n  `descs` varchar(128) DEFAULT NULL COMMENT \'订单说明\',\r\n  `create_time` datetime NOT NULL COMMENT \'申请时间（CR 时的时间）\',\r\n  `cancle_time` datetime DEFAULT NULL COMMENT \'取消时间\',\r\n  `done_time` datetime DEFAULT NULL COMMENT \'完成时间（DONE‘FAIL 共用此时间）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户购物订单表\';\r\n\r\n-- ----------------------------\r\n-- Records of orders\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user`;\r\nCREATE TABLE `user` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登陆账户（长度4-16）\',\r\n  `pwd` char(32) NOT NULL COMMENT \'登陆密码（长度6-20，大小写字母+数字，需要MD5加密32位）\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'姓名\',\r\n  `phone` varchar(16) DEFAULT NULL COMMENT \'电话（仅限手机号）\',\r\n  `idcard` varchar(18) DEFAULT NULL COMMENT \'身份证\',\r\n  `recommend_code` char(32) DEFAULT NULL COMMENT \'推荐人编码\',\r\n  `recommend_login_account` varchar(32) NOT NULL COMMENT \'推荐人账户\',\r\n  `role` varchar(10) NOT NULL DEFAULT \'CREATE\' COMMENT \'角色(CREATE:新注册, ACTIVATE:激活,OUT:出局)\',\r\n  `state` varchar(8) DEFAULT \'NORMAL\' COMMENT \'用户状态（NORMAL 正常，ABNORMAL 不正常）\',\r\n  `business_state` varchar(8) DEFAULT \'NO\' COMMENT \'商务中心状态(NO 未开通, APPLY 申请中, OPEN 已开通)\',\r\n  `is_need_cycle` char(1) NOT NULL DEFAULT \'N\' COMMENT \'是否需复投(Y 需要，N 不需要)\',\r\n  `cycle_start_time` datetime DEFAULT NULL COMMENT \'复投开始时间:用户什么时候进入复投期的\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户\';\r\n\r\n-- ----------------------------\r\n-- Records of user\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_account\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_account`;\r\nCREATE TABLE `user_account` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `vn` int(11) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'账户状态(NORMAL 正常，LOCK 冻结)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户\';\r\n\r\n-- ----------------------------\r\n-- Records of user_account\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_account_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_account_rec`;\r\nCREATE TABLE `user_account_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户流水\';\r\n\r\n-- ----------------------------\r\n-- Records of user_account_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_activation_apply\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_activation_apply`;\r\nCREATE TABLE `user_activation_apply` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `apply_code` char(32) DEFAULT NULL COMMENT \'申请编码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码(审核发放激活码时，回填交易码)\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码(平台生成时，此为空)\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'激活码单价\',\r\n  `num` smallint(6) DEFAULT NULL COMMENT \'申请数量\',\r\n  `total_price` decimal(10,2) DEFAULT NULL COMMENT \'申请总价（折扣之后的总价）\',\r\n  `rate_price` decimal(10,2) DEFAULT NULL COMMENT \'折后总价\',\r\n  `rate` smallint(6) DEFAULT NULL COMMENT \'折扣(1700代表17%)\',\r\n  `state` varchar(8) DEFAULT NULL COMMENT \'申请状态(APPLY 申请中, PASS 已发放)\',\r\n  `admin_code` char(32) DEFAULT NULL COMMENT \'审核管理员编码\',\r\n  `admin_name` varchar(64) DEFAULT NULL COMMENT \'审核管理员名称\',\r\n  `apply_time` datetime DEFAULT NULL COMMENT \'申请时间\',\r\n  `audit_time` datetime DEFAULT NULL COMMENT \'审核时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'激活码申请表\';\r\n\r\n-- ----------------------------\r\n-- Records of user_activation_apply\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_activation_code\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_activation_code`;\r\nCREATE TABLE `user_activation_code` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `apply_code` char(32) DEFAULT NULL COMMENT \'申请编码(平台生成时，此为空)\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码(平台生成时，此为空)\',\r\n  `activation_code` char(32) DEFAULT NULL COMMENT \'激活码，此码唯一(仅供用户注册使用)\',\r\n  `is_activate` char(1) DEFAULT NULL COMMENT \'是否被激活(Y 是，N 否)\',\r\n  `activate_user_code` char(32) DEFAULT NULL COMMENT \'激活用户编码(平台生成时，此为空)\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'激活用户账户(平台生成时，此为空)\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'单价\',\r\n  `admin_code` char(32) DEFAULT NULL COMMENT \'发放管理员编码\',\r\n  `admin_name` varchar(64) DEFAULT NULL COMMENT \'发放管理员名称\',\r\n  `create_time` datetime DEFAULT NULL COMMENT \'发放时间\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间(平台生成时，此为空)\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'激活码(1 平台拿到用户的钱生成激活码，2平台审核商务中心申请并核账生成激活码)\';\r\n\r\n-- ----------------------------\r\n-- Records of user_activation_code\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_draw_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_draw_rec`;\r\nCREATE TABLE `user_draw_rec` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `draw_money` decimal(10,2) NOT NULL COMMENT \'提现金额\',\r\n  `brokerage` decimal(10,2) NOT NULL DEFAULT 0.00 COMMENT \'提现手续费\',\r\n  `really_draw` decimal(10,2) DEFAULT NULL COMMENT \'实际到账\',\r\n  `acct` varchar(32) NOT NULL COMMENT \'用户收款银行卡号\',\r\n  `bank` varchar(32) DEFAULT NULL COMMENT \'收款账号开户行\',\r\n  `bacct_name` varchar(32) DEFAULT NULL COMMENT \'收款姓名\',\r\n  `pay_way` varchar(10) DEFAULT \'REMIT\' COMMENT \'交易方式（REMIT 银行转账，CASH 现金 枚举）\',\r\n  `pay_bank` varchar(64) DEFAULT NULL COMMENT \'平台汇款账号开户行\',\r\n  `pay_acct` varchar(32) DEFAULT NULL COMMENT \'平台汇款账号\',\r\n  `pay_bacct_name` varchar(32) DEFAULT NULL COMMENT \'平台汇款人（如果是银行转账REMIT时，此项必填）\',\r\n  `voucher_url` varchar(128) DEFAULT NULL COMMENT \'平台汇款凭证(记录上传的转账凭证图片，回填)\',\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'平台汇款备注\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'CR\' COMMENT \'状态(CR 提交申请, DEAL 提现处理中, DONE 提现到账, FAIL 提现失败)\',\r\n  `fail_reason` varchar(128) DEFAULT NULL COMMENT \'提现失败原因\',\r\n  `create_time` datetime NOT NULL COMMENT \'申请时间（CR 时的时间）\',\r\n  `deal_time` datetime DEFAULT NULL COMMENT \'处理时间（DEAL 时的时间）\',\r\n  `done_time` datetime DEFAULT NULL COMMENT \'完成时间（DONE‘FAIL 共用此时间）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户提现表\';\r\n\r\n-- ----------------------------\r\n-- Records of user_draw_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_fund\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_fund`;\r\nCREATE TABLE `user_fund` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `vn` int(11) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'账户状态(NORMAL 正常，LOCK 冻结)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户基金账户\';\r\n\r\n-- ----------------------------\r\n-- Records of user_fund\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_fund_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_fund_rec`;\r\nCREATE TABLE `user_fund_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户基金账户流水\';\r\n\r\n-- ----------------------------\r\n-- Records of user_fund_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_parent\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_parent`;\r\nCREATE TABLE `user_parent` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码\',\r\n  `parent_code` char(32) DEFAULT NULL COMMENT \'接点人编码(同一个接点人，下属仅能绑定两人)\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'接点人账户\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户接点关系(用户A的出局,A的两个下属之一向上B填缺,B之外的C换主为B,为每一个关系变动者做好变动记录)\';\r\n\r\n-- ----------------------------\r\n-- Records of user_parent\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_parent_change_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_parent_change_rec`;\r\nCREATE TABLE `user_parent_change_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `parent_code_old` char(32) NOT NULL COMMENT \'老推荐人编码\',\r\n  `parent_code_new` char(32) NOT NULL COMMENT \'新推荐人编码\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'变动说明\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户接点关系变动记录\';\r\n\r\n-- ----------------------------\r\n-- Records of user_parent_change_rec\r\n-- ----------------------------\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('60', '740048737994137600', '740281989078147072', 'DROP DATABASE if EXISTS d;\nCREATE DATABASE d;\nUSE d;\n /*\r\nNavicat MariaDB Data Transfer\r\n\r\nSource Server         : 192.168.10.250\r\nSource Server Version : 100208\r\nSource Host           : 192.168.10.250:3306\r\nSource Database       : cycle\r\n\r\nTarget Server Type    : MariaDB\r\nTarget Server Version : 100208\r\nFile Encoding         : 65001\r\n\r\nDate: 2018-01-23 09:02:02\r\n*/\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for admin\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `admin`;\r\nCREATE TABLE `admin` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\r\n  `code` char(32) NOT NULL COMMENT \'管理员编码\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'管理员名称\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登录账户(长度限制4-16)\',\r\n  `pwd` char(32) NOT NULL COMMENT \'密码(MD5加密32位)\',\r\n  `phone` char(11) DEFAULT NULL COMMENT \'手机号码\',\r\n  `idcard` char(18) DEFAULT NULL COMMENT \'身份证号\',\r\n  `role` varchar(8) DEFAULT \'NORMAL\' COMMENT \'角色（NORMAL 普通，SUPER 高级）\',\r\n  `state` char(16) DEFAULT \'OPEN\' COMMENT \'状态（OPEN 开启，DELETE 删除）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'管理员表\';\r\n\r\n-- ----------------------------\r\n-- Records of admin\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for basic_settings\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `basic_settings`;\r\nCREATE TABLE `basic_settings` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `k` varchar(32) NOT NULL COMMENT \'键\',\r\n  `v` text NOT NULL COMMENT \'值\',\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'系统基础关键配置表\';\r\n\r\n-- ----------------------------\r\n-- Records of basic_settings\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for coupon\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `coupon`;\r\nCREATE TABLE `coupon` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `release_user_code` char(32) DEFAULT NULL COMMENT \'释放人编码（直接触发人）\',\r\n  `indirect_user_code` char(32) DEFAULT NULL COMMENT \'间接释放人编码（第二层购买时产生）\',\r\n  `remark` varchar(256) NOT NULL COMMENT \'释放说明（您推广的B成功推广了C，为您释放16张代金券）\',\r\n  `coupon_code` char(32) NOT NULL COMMENT \'代金券编码\',\r\n  `num` smallint(6) NOT NULL COMMENT \'代金券期数\',\r\n  `coupon_price` decimal(10,2) NOT NULL COMMENT \'代金券面额\',\r\n  `fund_rate` smallint(6) DEFAULT NULL COMMENT \'基金抽取比例(1700代表17%)\',\r\n  `fund` decimal(10,2) DEFAULT NULL COMMENT \'抽取基金\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'实际释放额\',\r\n  `is_release` char(1) DEFAULT \'N\' COMMENT \'状态(Y: 已释放,N: 未释放)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `release_time` datetime DEFAULT NULL COMMENT \'释放时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'代金券释放计划（已完成的礼包中所有返还计划转移至历史表）\';\r\n\r\n-- ----------------------------\r\n-- Records of coupon\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for coupon_his\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `coupon_his`;\r\nCREATE TABLE `coupon_his` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `release_user_code` char(32) DEFAULT NULL COMMENT \'释放人编码（直接触发人）\',\r\n  `indirect_user_code` char(32) DEFAULT NULL COMMENT \'间接释放人编码（第二层购买时产生）\',\r\n  `remark` varchar(256) NOT NULL COMMENT \'释放说明（您推广的B成功推广了C，为您释放16张代金券）\',\r\n  `coupon_code` char(32) NOT NULL COMMENT \'代金券编码\',\r\n  `num` smallint(6) NOT NULL COMMENT \'代金券期数\',\r\n  `coupon_price` decimal(10,2) NOT NULL COMMENT \'代金券面额\',\r\n  `fund_rate` smallint(6) DEFAULT NULL COMMENT \'基金抽取比例(1700代表17%)\',\r\n  `fund` decimal(10,2) DEFAULT NULL COMMENT \'抽取基金\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'实际释放额\',\r\n  `is_release` char(1) DEFAULT \'Y\' COMMENT \'状态(Y: 已释放,N: 未释放)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `release_time` datetime DEFAULT NULL COMMENT \'释放时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'代金券释放计划历史表（已完成的礼包中所有返还计划转移至此）\';\r\n\r\n-- ----------------------------\r\n-- Records of coupon_his\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finace_plat\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finace_plat`;\r\nCREATE TABLE `finace_plat` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'总入账\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'总出账\',\r\n  `vn` bigint(20) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'平台财务账户\';\r\n\r\n-- ----------------------------\r\n-- Records of finace_plat\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finace_plat_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finace_plat_rec`;\r\nCREATE TABLE `finace_plat_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(32) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'平台财务流水\';\r\n\r\n-- ----------------------------\r\n-- Records of finace_plat_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for goods\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `goods`;\r\nCREATE TABLE `goods` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `goods_code` char(32) NOT NULL COMMENT \'商品编码\',\r\n  `goods_name` varchar(128) NOT NULL COMMENT \'商品名称\',\r\n  `goods_jingle` varchar(150) NOT NULL COMMENT \'商品广告词\',\r\n  `goods_image` varchar(128) NOT NULL COMMENT \'商品主图\',\r\n  `price` decimal(10,2) NOT NULL COMMENT \'价格\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'状态 DOWN下架，NORMAL正常\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'商品\';\r\n\r\n-- ----------------------------\r\n-- Records of goods\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for goods_buy_record\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `goods_buy_record`;\r\nCREATE TABLE `goods_buy_record` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `record_code` char(32) NOT NULL COMMENT \'购买礼包编号\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `goods_code` char(32) NOT NULL COMMENT \'商品编码\',\r\n  `goods_name` varchar(128) NOT NULL COMMENT \'商品名称\',\r\n  `goods_image` varchar(128) NOT NULL COMMENT \'商品主图\',\r\n  `is_first_buy` char(1) DEFAULT \'N\' COMMENT \'是否首次购买（Y 是，N否）当为Y时，需要用户完善收货信息及平台发货\',\r\n  `is_delivery` char(1) DEFAULT \'N\' COMMENT \'是否已发货（Y 是，N 否）\',\r\n  `activation_code` char(10) DEFAULT NULL COMMENT \'使用的激活码(is_first_buy=N时,此项为空)\',\r\n  `name` char(10) DEFAULT NULL COMMENT \'收货人姓名\',\r\n  `phone` char(10) DEFAULT NULL COMMENT \'收货人电话\',\r\n  `address` char(10) DEFAULT NULL COMMENT \'收货人地址\',\r\n  `price` decimal(10,2) NOT NULL COMMENT \'价格\',\r\n  `state` varchar(4) NOT NULL DEFAULT \'ING\' COMMENT \'释放状态(ING 释放中，OVER 释放完毕)\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'商品购买记录（释放完毕的礼包中对应的所有代金券转移至代金券历史表，复投时改变用户表is_need_cycle）\';\r\n\r\n-- ----------------------------\r\n-- Records of goods_buy_record\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for orders\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `orders`;\r\nCREATE TABLE `orders` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `order_code` char(32) NOT NULL COMMENT \'订单号\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登陆账户（长度4-16）\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'姓名\',\r\n  `phone` varchar(16) DEFAULT NULL COMMENT \'电话（仅限手机号）\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `total_price` decimal(10,2) NOT NULL COMMENT \'订单总额\',\r\n  `brokerage` decimal(10,2) NOT NULL DEFAULT 0.00 COMMENT \'订单手续费\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'CR\' COMMENT \'状态(CR 创建订单, DONE 处理完成, CANCLE 取消订单)\',\r\n  `descs` varchar(128) DEFAULT NULL COMMENT \'订单说明\',\r\n  `create_time` datetime NOT NULL COMMENT \'申请时间（CR 时的时间）\',\r\n  `cancle_time` datetime DEFAULT NULL COMMENT \'取消时间\',\r\n  `done_time` datetime DEFAULT NULL COMMENT \'完成时间（DONE‘FAIL 共用此时间）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户购物订单表\';\r\n\r\n-- ----------------------------\r\n-- Records of orders\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user`;\r\nCREATE TABLE `user` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登陆账户（长度4-16）\',\r\n  `pwd` char(32) NOT NULL COMMENT \'登陆密码（长度6-20，大小写字母+数字，需要MD5加密32位）\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'姓名\',\r\n  `phone` varchar(16) DEFAULT NULL COMMENT \'电话（仅限手机号）\',\r\n  `idcard` varchar(18) DEFAULT NULL COMMENT \'身份证\',\r\n  `recommend_code` char(32) DEFAULT NULL COMMENT \'推荐人编码\',\r\n  `recommend_login_account` varchar(32) NOT NULL COMMENT \'推荐人账户\',\r\n  `role` varchar(10) NOT NULL DEFAULT \'CREATE\' COMMENT \'角色(CREATE:新注册, ACTIVATE:激活,OUT:出局)\',\r\n  `state` varchar(8) DEFAULT \'NORMAL\' COMMENT \'用户状态（NORMAL 正常，ABNORMAL 不正常）\',\r\n  `business_state` varchar(8) DEFAULT \'NO\' COMMENT \'商务中心状态(NO 未开通, APPLY 申请中, OPEN 已开通)\',\r\n  `is_need_cycle` char(1) NOT NULL DEFAULT \'N\' COMMENT \'是否需复投(Y 需要，N 不需要)\',\r\n  `cycle_start_time` datetime DEFAULT NULL COMMENT \'复投开始时间:用户什么时候进入复投期的\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户\';\r\n\r\n-- ----------------------------\r\n-- Records of user\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_account\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_account`;\r\nCREATE TABLE `user_account` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `vn` int(11) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'账户状态(NORMAL 正常，LOCK 冻结)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户\';\r\n\r\n-- ----------------------------\r\n-- Records of user_account\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_account_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_account_rec`;\r\nCREATE TABLE `user_account_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户流水\';\r\n\r\n-- ----------------------------\r\n-- Records of user_account_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_activation_apply\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_activation_apply`;\r\nCREATE TABLE `user_activation_apply` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `apply_code` char(32) DEFAULT NULL COMMENT \'申请编码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码(审核发放激活码时，回填交易码)\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码(平台生成时，此为空)\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'激活码单价\',\r\n  `num` smallint(6) DEFAULT NULL COMMENT \'申请数量\',\r\n  `total_price` decimal(10,2) DEFAULT NULL COMMENT \'申请总价（折扣之后的总价）\',\r\n  `rate_price` decimal(10,2) DEFAULT NULL COMMENT \'折后总价\',\r\n  `rate` smallint(6) DEFAULT NULL COMMENT \'折扣(1700代表17%)\',\r\n  `state` varchar(8) DEFAULT NULL COMMENT \'申请状态(APPLY 申请中, PASS 已发放)\',\r\n  `admin_code` char(32) DEFAULT NULL COMMENT \'审核管理员编码\',\r\n  `admin_name` varchar(64) DEFAULT NULL COMMENT \'审核管理员名称\',\r\n  `apply_time` datetime DEFAULT NULL COMMENT \'申请时间\',\r\n  `audit_time` datetime DEFAULT NULL COMMENT \'审核时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'激活码申请表\';\r\n\r\n-- ----------------------------\r\n-- Records of user_activation_apply\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_activation_code\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_activation_code`;\r\nCREATE TABLE `user_activation_code` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `apply_code` char(32) DEFAULT NULL COMMENT \'申请编码(平台生成时，此为空)\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码(平台生成时，此为空)\',\r\n  `activation_code` char(32) DEFAULT NULL COMMENT \'激活码，此码唯一(仅供用户注册使用)\',\r\n  `is_activate` char(1) DEFAULT NULL COMMENT \'是否被激活(Y 是，N 否)\',\r\n  `activate_user_code` char(32) DEFAULT NULL COMMENT \'激活用户编码(平台生成时，此为空)\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'激活用户账户(平台生成时，此为空)\',\r\n  `price` decimal(10,2) DEFAULT NULL COMMENT \'单价\',\r\n  `admin_code` char(32) DEFAULT NULL COMMENT \'发放管理员编码\',\r\n  `admin_name` varchar(64) DEFAULT NULL COMMENT \'发放管理员名称\',\r\n  `create_time` datetime DEFAULT NULL COMMENT \'发放时间\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间(平台生成时，此为空)\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'激活码(1 平台拿到用户的钱生成激活码，2平台审核商务中心申请并核账生成激活码)\';\r\n\r\n-- ----------------------------\r\n-- Records of user_activation_code\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_draw_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_draw_rec`;\r\nCREATE TABLE `user_draw_rec` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `draw_money` decimal(10,2) NOT NULL COMMENT \'提现金额\',\r\n  `brokerage` decimal(10,2) NOT NULL DEFAULT 0.00 COMMENT \'提现手续费\',\r\n  `really_draw` decimal(10,2) DEFAULT NULL COMMENT \'实际到账\',\r\n  `acct` varchar(32) NOT NULL COMMENT \'用户收款银行卡号\',\r\n  `bank` varchar(32) DEFAULT NULL COMMENT \'收款账号开户行\',\r\n  `bacct_name` varchar(32) DEFAULT NULL COMMENT \'收款姓名\',\r\n  `pay_way` varchar(10) DEFAULT \'REMIT\' COMMENT \'交易方式（REMIT 银行转账，CASH 现金 枚举）\',\r\n  `pay_bank` varchar(64) DEFAULT NULL COMMENT \'平台汇款账号开户行\',\r\n  `pay_acct` varchar(32) DEFAULT NULL COMMENT \'平台汇款账号\',\r\n  `pay_bacct_name` varchar(32) DEFAULT NULL COMMENT \'平台汇款人（如果是银行转账REMIT时，此项必填）\',\r\n  `voucher_url` varchar(128) DEFAULT NULL COMMENT \'平台汇款凭证(记录上传的转账凭证图片，回填)\',\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'平台汇款备注\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'CR\' COMMENT \'状态(CR 提交申请, DEAL 提现处理中, DONE 提现到账, FAIL 提现失败)\',\r\n  `fail_reason` varchar(128) DEFAULT NULL COMMENT \'提现失败原因\',\r\n  `create_time` datetime NOT NULL COMMENT \'申请时间（CR 时的时间）\',\r\n  `deal_time` datetime DEFAULT NULL COMMENT \'处理时间（DEAL 时的时间）\',\r\n  `done_time` datetime DEFAULT NULL COMMENT \'完成时间（DONE‘FAIL 共用此时间）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户账户提现表\';\r\n\r\n-- ----------------------------\r\n-- Records of user_draw_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_fund\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_fund`;\r\nCREATE TABLE `user_fund` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT 0.00 COMMENT \'账户余额\',\r\n  `vn` int(11) NOT NULL DEFAULT 1 COMMENT \'版本号\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'账户状态(NORMAL 正常，LOCK 冻结)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户基金账户\';\r\n\r\n-- ----------------------------\r\n-- Records of user_fund\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_fund_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_fund_rec`;\r\nCREATE TABLE `user_fund_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT 0.00 COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT 0.00 COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（REMIT 线下支付，TRANSFER 账户转账，ACCOUNT 账户支付 等枚举）\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户基金账户流水\';\r\n\r\n-- ----------------------------\r\n-- Records of user_fund_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_parent\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_parent`;\r\nCREATE TABLE `user_parent` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码\',\r\n  `parent_code` char(32) DEFAULT NULL COMMENT \'接点人编码(同一个接点人，下属仅能绑定两人)\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'接点人账户\',\r\n  `activate_time` datetime DEFAULT NULL COMMENT \'激活时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户接点关系(用户A的出局,A的两个下属之一向上B填缺,B之外的C换主为B,为每一个关系变动者做好变动记录)\';\r\n\r\n-- ----------------------------\r\n-- Records of user_parent\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for user_parent_change_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `user_parent_change_rec`;\r\nCREATE TABLE `user_parent_change_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `parent_code_old` char(32) NOT NULL COMMENT \'老推荐人编码\',\r\n  `parent_code_new` char(32) NOT NULL COMMENT \'新推荐人编码\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'变动说明\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT=\'用户接点关系变动记录\';\r\n\r\n-- ----------------------------\r\n-- Records of user_parent_change_rec\r\n-- ----------------------------\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('61', '740078493527580672', '740078665326272512', 'DROP DATABASE if EXISTS treasure;\nCREATE DATABASE treasure;\nUSE treasure;\n /*\r\nNavicat MySQL Data Transfer\r\n\r\nSource Server         : 192.168.10.220\r\nSource Server Version : 100123\r\nSource Host           : 192.168.10.220:3306\r\nSource Database       : treasure\r\n\r\nTarget Server Type    : MYSQL\r\nTarget Server Version : 100123\r\nFile Encoding         : 65001\r\n\r\nDate: 2018-01-31 14:07:40\r\n*/\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for admin\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `admin`;\r\nCREATE TABLE `admin` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'主键ID\',\r\n  `code` char(32) NOT NULL COMMENT \'管理员编码\',\r\n  `name` varchar(64) DEFAULT NULL COMMENT \'管理员名称\',\r\n  `login_account` varchar(32) NOT NULL COMMENT \'登录账户(长度限制4-16)\',\r\n  `pwd` char(32) NOT NULL COMMENT \'密码(MD5加密32位)\',\r\n  `phone` char(11) DEFAULT NULL COMMENT \'手机号码\',\r\n  `idcard` char(18) DEFAULT NULL COMMENT \'身份证号\',\r\n  `role` varchar(8) DEFAULT \'NORMAL\' COMMENT \'角色（NORMAL 普通，SUPER 高级）\',\r\n  `state` char(16) DEFAULT \'OPEN\' COMMENT \'状态（OPEN 开启，DEL 删除）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'管理员表\';\r\n\r\n-- ----------------------------\r\n-- Records of admin\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for basic_settings\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `basic_settings`;\r\nCREATE TABLE `basic_settings` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `k` varchar(64) NOT NULL COMMENT \'键\',\r\n  `v` text NOT NULL COMMENT \'值\',\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'系统基础关键配置表\';\r\n\r\n-- ----------------------------\r\n-- Records of basic_settings\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for cust\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `cust`;\r\nCREATE TABLE `cust` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'会员编码\',\r\n  `cust_name` varchar(50) DEFAULT NULL COMMENT \'会员名称\',\r\n  `cust_truename` varchar(20) DEFAULT NULL COMMENT \'真实姓名\',\r\n  `cust_avatar` varchar(50) DEFAULT NULL COMMENT \'会员头像\',\r\n  `cust_sex` varchar(6) DEFAULT \'UNKNOW\' COMMENT \'会员性别 MALE男 FAEMALE女 UNKNOW未知\',\r\n  `cust_birthday` date DEFAULT NULL COMMENT \'生日\',\r\n  `cust_phone` varchar(11) DEFAULT NULL COMMENT \'手机号\',\r\n  `cust_phone_bind` char(1) DEFAULT \'N\' COMMENT \'手机号绑定 Y是 N否\',\r\n  `cust_login_num` int(11) unsigned DEFAULT \'1\' COMMENT \'登录次数\',\r\n  `cust_openid` varchar(32) NOT NULL COMMENT \'微信用户的标识，对当前公众号唯一\',\r\n  `cust_unionid` varchar(32) DEFAULT NULL COMMENT \'微信unionId\',\r\n  `cust_nickname` varchar(128) DEFAULT NULL COMMENT \'微信用户昵称\',\r\n  `cust_login_time` datetime DEFAULT NULL COMMENT \'当前登录时间\',\r\n  `cust_old_login_time` datetime DEFAULT NULL COMMENT \'上次登录时间\',\r\n  `cust_login_ip` varchar(20) DEFAULT NULL COMMENT \'当前登录ip\',\r\n  `cust_old_login_ip` varchar(20) DEFAULT NULL COMMENT \'上次登录ip\',\r\n  `auth_state` varchar(8) NOT NULL DEFAULT \'UNAUTH\' COMMENT \'认证状态（AUTH 认证通过，UNAUTH 未认证，EXPIRED 认证过期）\',\r\n  `state` varchar(8) NOT NULL COMMENT \'状态（NORMAL 已正常；FREEZE 已冻结；DELETE 删除；）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'用户\';\r\n\r\n-- ----------------------------\r\n-- Records of cust\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for evaluate\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `evaluate`;\r\nCREATE TABLE `evaluate` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `receive_code` varchar(32) NOT NULL COMMENT \'宝箱编码\',\r\n  `treasure_code` varchar(32) NOT NULL COMMENT \'宝箱编码\',\r\n  `from_cust_code` varchar(32) NOT NULL COMMENT \'客户编码\',\r\n  `to_cust_code` varchar(32) DEFAULT NULL COMMENT \'客户编码\',\r\n  `cust_name` varchar(50) DEFAULT NULL COMMENT \'会员名称\',\r\n  `cust_phone` varchar(11) DEFAULT NULL COMMENT \'手机号\',\r\n  `cust_avatar` varchar(50) DEFAULT NULL COMMENT \'会员头像\',\r\n  `comment_text` varchar(128) DEFAULT \'好评\' COMMENT \'评价内容\',\r\n  `comment_star` tinyint(4) DEFAULT NULL COMMENT \'商品评价（1 无法忍受，2 比较差；3 一般；4 很好；5 特别好）\',\r\n  `evaluate_plat` varchar(20) DEFAULT NULL COMMENT \'下单终端(WEB网站 IOS苹果 ANDROID安卓 WAP手机网站 WXWEB微信公众号 WXXCX 微信小程序)\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  `state` varchar(10) NOT NULL DEFAULT \'NOMAL\' COMMENT \'状态（NOMAL正常显示；DEL已删除；）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'评价\';\r\n\r\n-- ----------------------------\r\n-- Records of evaluate\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finance_cust\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finance_cust`;\r\nCREATE TABLE `finance_cust` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'代理商编码\',\r\n  `balance` decimal(18,2) NOT NULL COMMENT \'账户余额\',\r\n  `state` varchar(10) NOT NULL DEFAULT \'0\' COMMENT \'状态 NORMAL 正常；FREEZE 冻结；\',\r\n  `remark` varchar(64) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'用户账户余额\';\r\n\r\n-- ----------------------------\r\n-- Records of finance_cust\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finance_cust_draw\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finance_cust_draw`;\r\nCREATE TABLE `finance_cust_draw` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) NOT NULL COMMENT \'用户编码\',\r\n  `draw_money` decimal(10,2) NOT NULL COMMENT \'提现金额\',\r\n  `brokerage` decimal(10,2) NOT NULL DEFAULT \'0.00\' COMMENT \'提现手续费\',\r\n  `really_draw` decimal(10,2) DEFAULT NULL COMMENT \'实际到账\',\r\n  `openid` varchar(32) DEFAULT NULL,\r\n  `pay_way` varchar(10) DEFAULT \'REMIT\' COMMENT \'交易方式（REMIT 银行转账，WXPAY 微信 默认微信转账）\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'CR\' COMMENT \'状态(CR 提交申请, DEAL 提现处理中, DONE 提现到账, FAIL 提现失败)\',\r\n  `fail_reason` varchar(128) DEFAULT NULL COMMENT \'提现失败原因\',\r\n  `fail_count` int(1) DEFAULT NULL COMMENT \'提现失败次数 最大为3次  默认为0  失败一次累加一次\',\r\n  `create_time` datetime NOT NULL COMMENT \'申请时间（CR 时的时间）\',\r\n  `deal_time` datetime DEFAULT NULL COMMENT \'处理时间（DEAL 时的时间）\',\r\n  `done_time` datetime DEFAULT NULL COMMENT \'完成时间（DONE‘FAIL 共用此时间）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'用户账户提现表\';\r\n\r\n-- ----------------------------\r\n-- Records of finance_cust_draw\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finance_cust_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finance_cust_rec`;\r\nCREATE TABLE `finance_cust_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` varchar(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` varchar(32) NOT NULL COMMENT \'交易码\',\r\n  `income` decimal(8,2) NOT NULL COMMENT \'收入\',\r\n  `expenditure` decimal(8,2) DEFAULT NULL,\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（WXPAY微信支付，ACCOUNT账户支付  默认使用账户支付）\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'微信对象的用户编码\',\r\n  `acct` varchar(32) DEFAULT NULL COMMENT \'第三方支付账号\',\r\n  `tc3rd` varchar(64) DEFAULT NULL COMMENT \'第三方交易流水码\',\r\n  `summary` varchar(128) DEFAULT NULL COMMENT \'摘要\',\r\n  `remark` varchar(32) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `is_sync` char(1) DEFAULT \'N\' COMMENT \'是否同步账户(Y是，N否 默认未同步)\',\r\n  `sync_time` datetime DEFAULT NULL COMMENT \'同步账户时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'用户财务流水\';\r\n\r\n-- ----------------------------\r\n-- Records of finance_cust_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finance_plat\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finance_plat`;\r\nCREATE TABLE `finance_plat` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `balance` decimal(18,2) NOT NULL DEFAULT \'0.00\' COMMENT \'账户余额\',\r\n  `income` decimal(18,2) DEFAULT \'0.00\' COMMENT \'总入账\',\r\n  `expenditure` decimal(18,2) DEFAULT \'0.00\' COMMENT \'总出账\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'更新时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'平台财务账户\';\r\n\r\n-- ----------------------------\r\n-- Records of finance_plat\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for finance_plat_rec\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `finance_plat_rec`;\r\nCREATE TABLE `finance_plat_rec` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `sn` char(32) NOT NULL COMMENT \'流水码\',\r\n  `tc` char(32) NOT NULL COMMENT \'交易码\',\r\n  `user_code` char(32) DEFAULT NULL COMMENT \'用户编码\',\r\n  `income` decimal(18,2) DEFAULT \'0.00\' COMMENT \'收入\',\r\n  `expenditure` decimal(18,2) DEFAULT \'0.00\' COMMENT \'支出\',\r\n  `subject` varchar(32) NOT NULL COMMENT \'会计科目\',\r\n  `subject_name` varchar(64) NOT NULL COMMENT \'会计科目名称\',\r\n  `direction` char(6) NOT NULL COMMENT \'记录方向（SINGLE 单方记录；DOUBLE 双方记录）\',\r\n  `pay_way` varchar(10) NOT NULL COMMENT \'交易方式（WXPAY微信支付，ACCOUNT账户支付 等枚举）\',\r\n  `remark` varchar(256) DEFAULT NULL COMMENT \'备注\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `is_sync` char(1) DEFAULT \'N\' COMMENT \'是否同步账户(Y是，N否 默认未同步)\',\r\n  `sync_time` datetime DEFAULT NULL COMMENT \'同步账户时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'平台财务流水\';\r\n\r\n-- ----------------------------\r\n-- Records of finance_plat_rec\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for treasure\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `treasure`;\r\nCREATE TABLE `treasure` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `treasure_code` varchar(32) NOT NULL COMMENT \'宝箱编码\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'会员编码\',\r\n  `treasure_type` varchar(20) NOT NULL COMMENT \'宝箱分类(TEXT:文字宝箱； IMAGE:图片宝箱；VOICE:语音；CANVAS:画板;VIDEO:视频)\',\r\n  `prompt` varchar(100) NOT NULL COMMENT \'宝箱提示\',\r\n  `text_content` varchar(200) DEFAULT NULL COMMENT \'文字宝箱内容\',\r\n  `content_url` varchar(255) DEFAULT \'N\' COMMENT \'宝箱内容路径\',\r\n  `content_desc` varchar(200) DEFAULT \'N\' COMMENT \'宝箱内容描述\',\r\n  `theme_style` varchar(20) NOT NULL DEFAULT \'DEF\' COMMENT \'主题风格(DEF:默认主题，ONE:主题一，TWO:主题二，THREE:主题三)\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'状态 NORMAL正常，END结束，DISABLE禁用\',\r\n  `is_pay` char(1) NOT NULL DEFAULT \'Y\' COMMENT \'是否支付(Y:需要支付; N:不需要支付，默认为Y)\',\r\n  `receive_count` int(8) NOT NULL DEFAULT \'0\' COMMENT \'领取次数,默认0\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  `end_time` datetime NOT NULL,\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=100018 DEFAULT CHARSET=utf8 COMMENT=\'宝箱\';\r\n\r\n-- ----------------------------\r\n-- Records of treasure\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for treasure_price\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `treasure_price`;\r\nCREATE TABLE `treasure_price` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `price_code` varchar(32) NOT NULL,\r\n  `treasure_code` varchar(32) NOT NULL COMMENT \'商品编码（商品基本编码+销售属性组编码）\',\r\n  `price` decimal(8,2) NOT NULL COMMENT \'商品广告词\',\r\n  `price_desc` varchar(200) DEFAULT NULL COMMENT \'分类名称\',\r\n  `create_time` datetime NOT NULL COMMENT \'商品添加时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=100018 DEFAULT CHARSET=utf8 COMMENT=\'宝箱设定价格\';\r\n\r\n-- ----------------------------\r\n-- Records of treasure_price\r\n-- ----------------------------\r\n\r\n-- ----------------------------\r\n-- Table structure for treasure_receive\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `treasure_receive`;\r\nCREATE TABLE `treasure_receive` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `receive_code` varchar(32) NOT NULL COMMENT \'宝箱编码\',\r\n  `tc` varchar(32) DEFAULT NULL COMMENT \'交易码\',\r\n  `treasure_code` varchar(32) NOT NULL COMMENT \'宝箱编码\',\r\n  `receive_name` varchar(50) DEFAULT NULL,\r\n  `receive_avatar` varchar(255) DEFAULT NULL,\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'订单号\',\r\n  `price` decimal(8,2) DEFAULT NULL COMMENT \'支付金额\',\r\n  `publisher_code` varchar(32) NOT NULL,\r\n  `remark` varchar(128) DEFAULT NULL COMMENT \'备注（平台添加，仅平台可见）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `is_forward` char(1) NOT NULL COMMENT \'是否转发 (Y：转发 N： 未转发   默认是未转发)\',\r\n  `is_anonymous` char(1) NOT NULL DEFAULT \'N\' COMMENT \'是否匿名（Y:匿名 N:不匿名，默认为N）\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT=\'宝箱领取\';\r\n\r\n-- ----------------------------\r\n-- Records of treasure_receive\r\n-- ----------------------------\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('68', '741610147585064960', '741610302203887616', 'DROP DATABASE if EXISTS dubbo;\nCREATE DATABASE dubbo;\nUSE dubbo;\n CREATE TABLE `cust_addr` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'会员编码\',\r\n  `receiver_name` varchar(50) NOT NULL COMMENT \'收货人名称\',\r\n  `area_code` char(12) NOT NULL COMMENT \'区域编码\',\r\n  `area_name` varchar(32) NOT NULL COMMENT \'区域名称\',\r\n  `area_full_name` varchar(128) NOT NULL COMMENT \'区域全称\',\r\n  `address` varchar(255) NOT NULL COMMENT \'地址\',\r\n  `tel_phone` varchar(20) DEFAULT NULL COMMENT \'座机电话\',\r\n  `mob_phone` varchar(15) DEFAULT NULL COMMENT \'手机电话\',\r\n  `is_default` char(1) NOT NULL DEFAULT \'N\' COMMENT \'默认收货地址 Y是 N否\',\r\n  `take_site_code` varchar(32) DEFAULT NULL COMMENT \'自提点编码\',\r\n  `take_site_name` varchar(64) DEFAULT NULL COMMENT \'自提点名字\',\r\n  `take_site_addr` varchar(128) DEFAULT NULL COMMENT \'自提点地址\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COMMENT=\'买家收货地址信息表（现自提点即代理商）\';\r\n\r\n', 'Enable');
