INSERT INTO `project_sql` VALUES ('72', '741790673650565120', '741790845449256960', 'DROP DATABASE if EXISTS ssh4;\nCREATE DATABASE ssh4;\nUSE ssh4;\n /*\r\nNavicat MySQL Data Transfer\r\n\r\nSource Server         : 223\r\nSource Server Version : 50505\r\nSource Host           : 192.168.10.223:3306\r\nSource Database       : szh\r\n\r\nTarget Server Type    : MYSQL\r\nTarget Server Version : 50505\r\nFile Encoding         : 65001\r\n\r\nDate: 2018-02-01 10:52:33\r\n*/\r\n\r\nSET FOREIGN_KEY_CHECKS=0;\r\n\r\n-- ----------------------------\r\n-- Table structure for cust\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `cust`;\r\nCREATE TABLE `cust` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) DEFAULT NULL COMMENT \'会员编码\',\r\n  `cust_name` varchar(50) NOT NULL COMMENT \'会员名称\',\r\n  `cust_truename` varchar(20) DEFAULT NULL COMMENT \'真实姓名\',\r\n  `cust_phone` varchar(11) DEFAULT NULL COMMENT \'手机号\',\r\n  `cust_avatar` varchar(128) DEFAULT NULL COMMENT \'会员头像\',\r\n  `cust_sex` varchar(6) DEFAULT \'UNKNOW\' COMMENT \'会员性别 MALE男 FAEMALE女 UNKNOW未知\',\r\n  `area_code` char(12) DEFAULT NULL COMMENT \'区域编码\',\r\n  `area_name` varchar(32) DEFAULT NULL COMMENT \'区域名称\',\r\n  `area_full_name` varchar(128) DEFAULT NULL COMMENT \'区域全称\',\r\n  `cust_birthday` date DEFAULT NULL COMMENT \'生日\',\r\n  `cust_passwd` varchar(32) NOT NULL COMMENT \'会员密码\',\r\n  `cust_paypwd` char(32) DEFAULT NULL COMMENT \'支付密码\',\r\n  `cust_email` varchar(100) DEFAULT NULL COMMENT \'会员邮箱\',\r\n  `cust_email_bind` char(1) NOT NULL DEFAULT \'N\' COMMENT \'邮箱绑定Y是 N否\',\r\n  `cust_phone_bind` char(1) NOT NULL DEFAULT \'N\' COMMENT \'手机号绑定 Y是 N否\',\r\n  `is_member` varchar(3) NOT NULL DEFAULT \'N\' COMMENT \'是否是会员 N否 NEW新会员 OLD老会员（平台消费普通用户即可成为新会员，可享受会员价；老会员指三楂红已有积分会员，可使用积分抵扣，也可享受会员价）\',\r\n  `cust_login_num` int(11) unsigned NOT NULL DEFAULT 1 COMMENT \'登录次数\',\r\n  `cust_openid` varchar(32) DEFAULT NULL COMMENT \'微信用户的标识，对当前公众号唯一\',\r\n  `cust_unionid` varchar(32) DEFAULT NULL COMMENT \'微信unionId\',\r\n  `cust_nickname` varchar(128) DEFAULT NULL COMMENT \'微信用户昵称\',\r\n  `alipay_login_code` varchar(100) DEFAULT NULL COMMENT \'支付宝登录号\',\r\n  `cust_qq` varchar(100) DEFAULT NULL COMMENT \'qq\',\r\n  `cust_qqopenid` varchar(100) DEFAULT NULL COMMENT \'qq互联id\',\r\n  `cust_qqinfo` text DEFAULT NULL COMMENT \'qq账号相关信息\',\r\n  `cust_sinaopenid` varchar(100) DEFAULT NULL COMMENT \'新浪微博登录id\',\r\n  `cust_sinainfo` text DEFAULT NULL COMMENT \'新浪账号相关信息序列化值\',\r\n  `cust_points` int(11) NOT NULL DEFAULT 0 COMMENT \'会员积分\',\r\n  `cust_login_time` datetime DEFAULT NULL COMMENT \'当前登录时间\',\r\n  `cust_old_login_time` datetime DEFAULT NULL COMMENT \'上次登录时间\',\r\n  `cust_login_ip` varchar(20) DEFAULT NULL COMMENT \'当前登录ip\',\r\n  `cust_old_login_ip` varchar(20) DEFAULT NULL COMMENT \'上次登录ip\',\r\n  `inviter_code` varchar(32) DEFAULT NULL COMMENT \'邀请人编码\',\r\n  `auth_state` varchar(8) NOT NULL DEFAULT \'UNAUTH\' COMMENT \'认证状态(AUDIT 待审核，UNPASS 未通过,AUTH 认证通过，UNAUTH 未认证，EXPIRED 认证过期)\',\r\n  `state` varchar(8) NOT NULL DEFAULT \'NORMAL\' COMMENT \'状态（NORMAL 已正常；FREEZE 已冻结；DEL 删除）\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`),\r\n  UNIQUE KEY `cust_phone` (`cust_phone`) USING BTREE,\r\n  KEY `member_name` (`cust_name`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8mb4 COMMENT=\'用户\';\r\n\r\n-- ----------------------------\r\n-- Table structure for cust_addr\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `cust_addr`;\r\nCREATE TABLE `cust_addr` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'会员编码\',\r\n  `receiver_name` varchar(50) NOT NULL COMMENT \'收货人名称\',\r\n  `area_code` char(12) NOT NULL COMMENT \'区域编码\',\r\n  `area_name` varchar(32) NOT NULL COMMENT \'区域名称\',\r\n  `area_full_name` varchar(128) NOT NULL COMMENT \'区域全称\',\r\n  `address` varchar(255) NOT NULL COMMENT \'地址\',\r\n  `tel_phone` varchar(20) DEFAULT NULL COMMENT \'座机电话\',\r\n  `mob_phone` varchar(15) DEFAULT NULL COMMENT \'手机电话\',\r\n  `is_default` char(1) NOT NULL DEFAULT \'N\' COMMENT \'默认收货地址 Y是 N否\',\r\n  `take_site_code` varchar(32) DEFAULT NULL COMMENT \'自提点编码\',\r\n  `take_site_name` varchar(64) DEFAULT NULL COMMENT \'自提点名字\',\r\n  `take_site_addr` varchar(128) DEFAULT NULL COMMENT \'自提点地址\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime DEFAULT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=41 DEFAULT CHARSET=utf8mb4 COMMENT=\'买家收货地址信息表（现自提点即代理商）\';\r\n\r\n-- ----------------------------\r\n-- Table structure for cust_agent\r\n-- ----------------------------\r\nDROP TABLE IF EXISTS `cust_agent`;\r\nCREATE TABLE `cust_agent` (\r\n  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n  `cust_code` varchar(32) NOT NULL COMMENT \'用户编码\',\r\n  `agent_code` varchar(32) NOT NULL COMMENT \'代理商编码\',\r\n  `agent_name` varchar(64) NOT NULL COMMENT \'代理商名称\',\r\n  `is_default` char(1) NOT NULL COMMENT \'是否是默认服务代理商\',\r\n  `create_time` datetime NOT NULL COMMENT \'创建时间\',\r\n  `update_time` datetime NOT NULL COMMENT \'修改时间\',\r\n  PRIMARY KEY (`id`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8mb4 COMMENT=\'用户选择的服务代理商\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('73', '742797551423709184', '743364882244001792', 'DROP DATABASE if EXISTS announce;\nCREATE DATABASE announce;\nUSE announce;\n\r\n\r\n\r\n\r\n\r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n \r\n DROP TABLE IF EXISTS announce;\r\n\r\n/*==============================================================*/\r\n/* Table: announce                                              */\r\n/*==============================================================*/\r\nCREATE TABLE `announce`\r\n(\r\n   id                   BIGINT NOT NULL AUTO_INCREMENT COMMENT \'id\',\r\n   title                VARCHAR(32) NOT NULL COMMENT \'标题\',\r\n   content              TEXT NOT NULL COMMENT \'内容\',\r\n   state                CHAR(8) NOT NULL DEFAULT \'ONLINE\' COMMENT \'公告状态(发布上线 ONLINE，下线 NOLINE)\',\r\n   is_top               CHAR(1) COMMENT \'是否置顶(Y 是，N 否)，同时只有一个公告可以置顶\',\r\n   admin_code           CHAR(32) NOT NULL COMMENT \'发布管理员编码\',\r\n   admin_name           VARCHAR(64) NOT NULL COMMENT \'发布管理员名称\',\r\n   create_time          DATETIME NOT NULL COMMENT \'创建时间\',\r\n   end_time             DATETIME COMMENT \'结束时间\',\r\n   PRIMARY KEY (id)\r\n);\r\n\r\nALTER TABLE announce COMMENT \'系统公告\';\r\n', 'Enable');
INSERT INTO `project_sql` VALUES ('74', '744353205758427136', '744353772694110208', 'DROP DATABASE if EXISTS asdf;\nCREATE DATABASE asdf;\nUSE asdf;\nCREATE TABLE `build_tools` (\r\n  `id` bigint(20) NOT NULL AUTO_INCREMENT,\r\n  `code` varchar(64) NOT NULL COMMENT \'构建工具编码\',\r\n  `buildType` varchar(16) DEFAULT NULL COMMENT \'管理类型:Gradle,Maven\',\r\n  PRIMARY KEY (`id`,`code`)\r\n) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COMMENT=\'项目构建工具\';\r\n', 'Enable');
